    function setFriend(
        address _myAccount,
        address _friendAccount,
        string memory message
    ) internal {
        address _account =_myAccount;

        friends[_account][_friendAccount] = Friend({
            exists: true,
            addedAt: block.timestamp,
            message: message,
            deleted: false
        });
        myFriends[_account].push(_friendAccount);
        //此处只是单项添加好友，应对方接受后再次调用，即可双向。
