        Article memory article = Article({
            title:_title,
            article: _content,
            timestamp: block.timestamp,

            isDisplay: true
        });
        articles[_senderAccount].push(article);    

    } 

    function getArticles(address _account) internal view returns(Article[] memory){
        return articles[_account];

    }








